import React from "react";
import { Dropdown, DropdownButton } from "react-bootstrap";

const AdminDropdown = () => {
  return (
    <DropdownButton id="admin-dropdown" title="Admin Panel">
      <Dropdown.Item href="#/approve-opportunity">Approve Posted Opportunity</Dropdown.Item>
      <Dropdown.Item href="#/approve-user">Approve New User</Dropdown.Item>
    </DropdownButton>
  );
};

export default AdminDropdown;
